unsafeScriptDataFromCbor :: String -> C.ScriptData
unsafeScriptDataFromCbor s =
  either
    (error . show)
    id
    (C.deserialiseFromCBOR
      (C.proxyToAsType Proxy)
      (fromMaybe (error "error") $ decodeHex $ Text.pack s)
    )

